import logo from './logo.svg';
import './App.css';
import UrlInput from './components/UrlInput';

function App() {
  return (
    <div className="App">
      <header className="App-header"></header>
      <div className="content">
        <UrlInput />
      </div>
    </div>
  );
}

export default App;
